import React from 'react';

const NavBar = () => {
  const navBarList = ["Boxing", "CrossFit", "Yoga", "Pilate", "Exercise", "Health", "Exercise", "Health", "CrossFit"];
  return (
    <>
      <ul className="list-inline">
        {navBarList && navBarList.map((item, index) => (
          <li className={index === 1 ? `active ColumnNav` : "ColumnNav"} key={index}>
            <span className="NavBarItems">
              {item}
            </span>
          </li>
        ))}
      </ul>
    </>
  );
};

export default NavBar;
